import React from 'react';
import { Container } from 'reactstrap';

const CaseCapture = props => {
    return (
        <Container fluid>
            <ol className="breadcrumb df-breadcrumbs mg-b-10" style={{ padding: 0, backgroundColor: 'transparent' }}>
                <li className="breadcrumb-item"><a href="/">Dashboard</a></li>
                <li className="breadcrumb-item">Cases</li>
                <li className="breadcrumb-item active" aria-current="page">Capture</li>
            </ol>
            <h4 className="mg-b-10 mg-t-30">Capture Single Case</h4>
            <p className="tx-14 mg-b-30">Please use form below to capture single case information and press the submit button.</p>
            <div className="tx-13 mg-b-25">
                <div className="df-example demo-forms">
                    <Row className="row-sm">
                        <Col sm={6}>
                            <input type="text" className="form-control" placeholder="" />
                        </Col>
                        <Col sm={6} class="mg-t-10 mg-sm-t-0">
                            <input type="text" className="form-control" placeholder="" />
                        </Col>
                    </Row>
                </div>
            </div>
        </Container>
    );
};

export default CaseCapture;
